from collections import Counter

def renumber_inventory(n, inventory_numbers):
    count = Counter(inventory_numbers)
    unused = list(set(range(1, n + 1)) + set(count.keys()))
    for i in range(n):
        if count[inventory_numbers[i]] > 1 or inventory_numbers[i] > n or inventory_numbers[i] <= 0:
            count[inventory_numbers[i]] -= 1
            inventory_numbers[i] = unused.pop()
    return inventory_numbers

